package com.example.propert_app.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class CategoryModel {    @SerializedName("status")    @Expose    public Integer status;    @SerializedName("message")    @Expose    public String message;    @SerializedName("data")    @Expose    public Data data;    public CategoryModel(Integer status, String message, Data data) {        super();        this.status = status;        this.message = message;        this.data = data;    }    public class Category {        @SerializedName("id")        @Expose        public Integer id;        @SerializedName("name")        @Expose        public String name;        @SerializedName("type")        @Expose        public String type;        @SerializedName("icon")        @Expose        public String icon;        public Category(Integer id, String name, String type, String icon) {            super();            this.id = id;            this.name = name;            this.type = type;            this.icon = icon;        }    }    public class Data {        @SerializedName("categories")        @Expose        public List<Category> categories = null;        public Data(List<Category> categories) {            super();            this.categories = categories;        }    }}